        type: string
    - name: api_key
      description: API key
      example: "xxxx-xxxx-xxxx-xxxx"
      required: true
      schema:
        type: string
    - name: verify_certificate
      description: Certificate verification
      required: true
      example: 'true'
      options:
        - false
        - true
      schema:
        type: string
    - name: http_proxy
      description: HTTP proxy
      required: false
      example: 'http://my-proxy:3128'
      schema:
        type: string
    - name: https_proxy
      description: HTTPS proxy
      required: false
      example: 'http://my-proxy:3128'
      schema:
        type: string
