  - name: fetch_incidents
    description: Fetches security events from the EDR Manager
    parameters:
      - name: base_url
        description: HarfangLab EDR Manager's URL
        required: true
        multiline: false
        example: 'https://hurukai:8443/'
        schema:
          type: string
      - name: api_key
        description: HarfangLab EDR's API Key
        required: true
        multiline: false
        example: 'xyzawxkjnsdkfjnsdf'
        schema:
          type: string
      - name: verify_certificate
        description: Certificate verification
        required: true
        example: 'true'
