          type: string
      - name: http_proxy
        description: HTTP proxy
        required: false
        example: 'http://my-proxy:3128'
        schema:
          type: string
      - name: https_proxy
        description: HTTPS proxy
        required: false
        example: 'http://my-proxy:3128'
        schema:
          type: string
      - name: first_fetch
        description: Start fetching alerts whose creation date is higher than now minus <first_fetch> days.
        required: false
        multiline: false
        example: '10'
        schema:
          type: string
      - name: alert_status
        description: Alert status
        required: false
        multiline: false
        example: 'ACTIVE'
        options:
          - ALL
          - ACTIVE
          - CLOSED
        schema:
          type: string
      - name: alert_type
        description: Comma-separated list of types of alerts to fetch (sigma, yara, hlai, vt, ransom, ioc, glimps, orion...).
        required: false
        multiline: false
        example: 'sigma,yara,hlai,ioc,ransom'
        schema:
          type: string
      - name: min_severity
        description: Minimum severity of alerts to fetch
        required: false
        multiline: false
        example: 'High'
        options:
          - Informational
          - Low
          - Medium
          - High
          - Critical
        schema:
          type: string
      - name: max_fetch
        description: Maximum number of alerts to fetch
        required: false
        multiline: false
        example: '10'
        schema:
          type: string
      - name: only_new_alerts
        description: Fetches only never fetched alerts
        required: false
        multiline: false
        example: 'true'
        options:
          - false
          - true
        schema:
          type: string
      - name: delay
        description: Number of seconds back in the past for the upper limit of security event timestamps (keep a value of minimum 120 secondes)
        required: true
        multiline: false
        example: 'true'
        schema:
          type: string
      - name: exclude_rules
        description: Do not take these rule names into account
        required: false
        multiline: true
        example: 'Windows Defender has taken action from malware'
        schema:
          type: string

    returns:
      schema:
        type: string

